import React from "react";

function MiExperiencia () {
    return (
        <div className="experiencia">
            <h2>Experiencia</h2>
            <h3>Agosto 2023 - Septiembre 2023</h3>
            <p>Durante mi proyecto final, he trabajado con mi grupo para lograr un E-Commerce competitivo, implementando tecnologías avanzadas, para así conseguir una aplicación </p>
      <p>Soy un desarrollador web con experiencia en tecnologías front-end y back-end. Durante los últimos 5 años, he trabajado en diversos proyectos, incluyendo la creación de sitios web interactivos, aplicaciones web y sistemas de gestión de contenido.</p>
      <p>Mi enfoque principal ha sido el desarrollo con tecnologías como HTML, CSS, JavaScript, React, Node.js y bases de datos SQL y NoSQL. También tengo experiencia en la creación de APIs RESTful y la implementación de autenticación de usuarios.</p>
      <p>Estoy apasionado por aprender nuevas tecnologías y mantenerme actualizado con las últimas tendencias en desarrollo web. Siempre me esfuerzo por crear soluciones eficientes y atractivas para los proyectos en los que trabajo.</p>
    </div>
  );
}

export default MiExperiencia;
